import "./Collaborator.css";

const Collaborator = () => {
  return (
    <div className="collaborator">
      <div className="head">
        <img src="https://github.com/nicolaswalser.pg" alt="Nicolas" />
        <div className="info">
          <h4>Nicolas Walser</h4>
          <h5>Student</h5>
        </div>
      </div>
    </div>
  );
};

export default Collaborator;
